import './App.css';
import { Router, Routes, Route } from 'react-router-dom';
import Home from "./Home"
import Dashboard from "./Dashboard"

function App() {
  return (
      <div className="App">
        <Route exact path="/home" component={ <Home />} />
        <Route exact path="/dashboard" component={ <Dashboard />} />
      </div>
  );
}

export default App;
